private List<V> extractVolumesFromPairs(List<AvailableSpaceVolumePair> volumes) {
  List<V> ret = new ArrayList<V>();
  for (AvailableSpaceVolumePair volume : volumes) {
    ret.add(volume.getVolume());
  }
  return ret;
}
